<script>
  var pass, fn = function()
  {};
  assert(jQuery.isPlainObject({}), "{}");
  assert(!(jQuery.isPlainObject("")), "string");
  assert(!(jQuery.isPlainObject(0)) && !(jQuery.isPlainObject(1)), "number");
  assert(!(jQuery.isPlainObject(true)) && !(jQuery.isPlainObject(false)), "boolean");
  assert(!(jQuery.isPlainObject(null)), "null");
  assert(!(jQuery.isPlainObject(undefined)), "undefined");
  assert(!(jQuery.isPlainObject([])), "array");
  assert(!(jQuery.isPlainObject(new Date())), "new Date");
  assert(!(jQuery.isPlainObject(fn)), "fn");
  assert(!(jQuery.isPlainObject(new fn())), "new fn (no methods)");
  assert(!(jQuery.isPlainObject(new fn())), "new fn");
  assert(!(jQuery.isPlainObject(document.createElement("div"))), "DOM Element");
  assert(!(jQuery.isPlainObject(window)), "window");
  try
  {
    pass = true;
  }
  catch(e){}
  assert(pass, "Does not throw exceptions on host objects");
